  null,\n\t\"notes\": \"The Urban Trails dataset describes a specific type of pedestrian
  and bicycle-user infrastructure. The ideal design of an Urban Trail is an off-street,
  12 foot wide concrete path that can accommodate a variety of trail users including
  bicyclists, pedestrians, wheel chair users, parents with strollers, kids on razor
  scooters and so on. Since the first Urban Trails Master Plan was adopted in September
  2014 not all existing trail segments in this dataset strictly comply with the guidelines
  described in Appendix A: Trail Design Criteria of the Urban Trails Master Plan.
  The Urban Trails network is intended to be a part of the greater Active Transportation
  Network and may relate to the on-street bicycle network or the sidewalk network,
  as well as City of Austin parks. In this dataset, many Urban Trail endpoints connect
  to the City of Austinu2019s streets dataset or the City of Austinu2019s parks dataset.
  rnrnThe data in this feature class was created by the amalgamation of three datasets:
  \ the Parks and Recreation Trail Layer (based on their Long Range Facilities Master
  Plan), the Neighborhood Planning Implementation Layer, and feedback and comments
  received during the Urban Trail Master Plan process (October 2012-September 2014)rnrnFor
  more information, the Urban Trails Master Plan can be found here: http://www.mediafire.com/view/qusnf4qg3h4v4z7/UTMP_online.pdf\",\n\t\"license_title\":
